import React from "react";
//import { RiMenu3Line, RiCloselin } from 'react-icons/ri';
import logo from '../../assets/logo.png'
import './navbar.css';


// bem -> Block Element Modifier

const Navbar = () => {
    return (
        <div className ="homepage__navbar">
            <div className ="homepage__navbar-links">
            <div className ="homepage__navbar-links__logo">
                <img src={logo} alt="logo" />
                <Text> Chewy's Chop Shop</Text>
            
            
            </div>
            <div className="homepage__navbar-links_container">
                <p><a href="#home"> Home </a></p>
                <p><a href="#home"> Gallery </a></p>
                <p><a href="#home"> Pricing </a></p>
                <p><a href="#home"> Contact Us </a></p>
                <p><a href="#home"> Page </a></p>
            </div>
            </div>
        </div>
    )
}
export default Navbar;
